import { LitElement, html } from "lit-element";

export class Game extends LitElement {
  createRenderRoot() {
    return this;
  }
  startClick() {
    const ri = document.querySelector('input[name="ri"]:checked');
    const le = document.querySelector('input[name="le"]:checked');
    const ti = document.querySelector('input[name="ti"]:checked');

    if (ri == null || le == null || ti == null) {
      let temp = document.createElement("div");
      temp.innerText = "선택좀;;";
      temp.style.color = "red";
      temp.style.fontSize = "2rem";
      temp.id = "error";
      document.getElementsByClassName("container")[0].appendChild(temp);
      return;
    } else {
      try {
        let temp = document.getElementById("error");
        temp.remove();
      } catch (e) {}
    }
    const data = {
      type: ri.value,
      runningTime: ti.value,
      level: le.value,
    };
    console.log(data);
  }
  render() {
    return html`
      <div class="container">
        <fieldset>
          <label class="item">
            <input
              type="radio"
              name="ri"
              class="item_radio"
              id="huey"
              value="0"
            />
            <label for="huey">+</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ri"
              class="item_radio"
              id="huey"
              value="1"
            />
            <label for="huey">-</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ri"
              class="item_radio"
              id="huey"
              value="2"
            />
            <label for="huey">✕</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ri"
              class="item_radio"
              id="huey"
              value="3"
            />
            <label for="huey">÷</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ri"
              class="item_radio"
              id="huey"
              value="4"
            />
            <label for="huey">ALL</label>
          </label>
        </fieldset>

        <fieldset>
          <label class="item">
            <input
              type="radio"
              name="le"
              class="item_radio"
              id="huey"
              value="0"
            />
            <label for="huey">0~10</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="le"
              class="item_radio"
              id="huey"
              value="1"
            />
            <label for="huey">0~20</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="le"
              class="item_radio"
              id="huey"
              value="2"
            />
            <label for="huey">0~50</label>
          </label>
        </fieldset>

        <fieldset>
          <label class="item">
            <input
              type="radio"
              name="ti"
              class="item_radio"
              id="huey"
              value="30"
            />
            <label for="huey">30s</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ti"
              class="item_radio"
              id="huey"
              value="60"
            />
            <label for="huey">1m</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ti"
              class="item_radio"
              id="huey"
              value="180"
            />
            <label for="huey">3m</label>
          </label>
          <label class="item">
            <input
              type="radio"
              name="ti"
              class="item_radio"
              id="huey"
              value="3000"
            />
            <label for="huey">5m</label>
          </label>
        </fieldset>
      </div>
      <button @click=${this.startClick} class="start">start</button>
    `;
  }
}
customElements.define("game-munu", Game);

export class Main extends LitElement {
  createRenderRoot() {
    return this;
  }
  startClick() {
    const ri = document.querySelector('input[name="ri"]:checked');
    const le = document.querySelector('input[name="le"]:checked');
    const ti = document.querySelector('input[name="ti"]:checked');

    if (ri == null || le == null || ti == null) {
      let temp = document.createElement("div");
      temp.innerText = "선택좀;;";
      temp.style.color = "red";
      temp.style.fontSize = "2rem";
      temp.id = "error";
      document.getElementsByClassName("container")[0].appendChild(temp);
      return;
    } else {
      try {
        let temp = document.getElementById("error");
        temp.remove();
      } catch (e) {}
    }
    const data = {
      type: ri.value,
      runningTime: ti.value,
      level: le.value,
    };
    console.log(data);
  }
  render() {
    return html`
      <div id="main" shadowroot="open">
        <div class="top"></div>
        <game-munu></game-munu>
      </div>
      <style>
        #main {
          height: 100vh;
          width: 100vw;
          display: flex;
          flex-flow: column;
          align-items: center;
          justify-content: center;
        }
        .start:hover {
          transform: scale(1.1);
        }
        #plus {
          font-size: 7rem;
          font-weight: 300;
          margin: 0;
          padding: 0;
          margin-top: 2rem;
          cursor: pointer;
          transition: all 0.2s ease-in-out;
        }
        .end {
          font-size: 8rem;
          font-weight: 300;
          margin: 0;
          padding: 0;
          margin-top: 1rem;
          cursor: pointer;
          transition: all 0.2s ease-in-out;
        }
        #input {
          font-size: 2rem;
          font-weight: 300;
          margin: 0;
          padding: 0;
          margin-top: 1rem;
          cursor: pointer;
          transition: all 0.2s ease-in-out;
        }
        .item {
          display: flex;
          margin-left: 1rem;
          text-align: center;
          justify-content: center;
        }
        .item_radio {
          width: 3vw;
        }
        .item_radio:checked + label {
          color: #2196f3;
          font-weight: 500;
        }

        game-munu {
          display: flex;
          flex-flow: column;
          align-items: center;
          justify-content: center;
        }
        .container {
          padding-left: 3vh;
          padding-right: 3vh;
          border: 0.6vh solid rgb(61, 61, 61);
          border-radius: 5vh;
        }
        fieldset {
          width: 100%;
          display: flex;
          border: none;
          font-size: 3rem;
        }
        .start {
          font-size: 2.5rem;
          font-weight: 300;
          margin: 0;
          padding: 0;
          margin-top: 1rem;
          cursor: pointer;
          transition: all 0.2s ease-in-out;
          display: flex;
          align-items: center;
          justify-content: center;
          width: 15vw;
          padding-left: 8vw;
          padding-right: 8vw;
          border: 0.6vh solid rgb(61, 61, 61);
          border-radius: 2vh;
          font-family: "GmarketSansMedium";
          font-weight: 500;
        }
        @font-face {
          font-family: "GmarketSansMedium";
          src: url("https://cdn.jsdelivr.net/gh/projectnoonnu/noonfonts_2001@1.1/GmarketSansMedium.woff")
            format("woff");
          font-weight: normal;
          font-style: normal;
        }
      </style>
    `;
  }
}

customElements.define("main-menu", Main);
